import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import Aux from './hoc/Auxiliary/Auxiliary';
import CalculatorInputs from '../src/components/CalculatorInputs/CalculatorInputs';
import WithErrorHandler from './hoc/withErrorHandler/ErrorBoundary';

function App() {
  return (
    <div>
      <center>
        <Aux>
          <WithErrorHandler>
            <CalculatorInputs />
          </WithErrorHandler>
        </Aux>
      </center>
    </div>
  );
}

export default App;
